import './App.css';
import React from 'react';
import ApplicationBar from "./menu/ApplicationBar";
import myPhoto from "../images/myPhotoBlackWhite.png"

function App() {
    return (
        <div id="main">
            <ApplicationBar/>
            <div id="box1"></div>
            <div id="box2">
                <div id="text">
                    HELLO<br/>Im Latifa
                </div>
            </div>
            <div id="box3">
                <div id="container">
                    <div id="logo">
                        <img src={myPhoto}/>
                    </div>
                    <div id="menu">
                        <ul>
                            <li>HOME</li>
                            <li>SERVICES</li>
                            <li>CONTACTS</li>
                            <li>HELP</li>
                        </ul>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default App;


